import React, { Component } from "react";
import axios from "axios";
// import "./app.css";
import { BrowserRouter as Router, Redirect, Link } from "react-router-dom";
import { observer, inject } from "mobx-react";
import { toJS } from "mobx";
@inject("store")
@observer
class HomeHeader extends Component {
  constructor() {
    super();
    this.state = {
      redirectTo: null,
      userInfo: {}
    };
  }
  logout = () => {
    this.props.store.userLogOut(this.props.store.getUser.id).then(() => {
      this.setState({
        redirectTo: "/logIn"
      });
    });
  };
  render() {
    return (
      <div className="home">
        <div className="nav-bar">
          <ul>
            <li className="name">
              <a href="#">{this.state.userInfo.name}</a>
            </li>
            <li>
              <a href="#">Home</a>
            </li>
            <li>
              <a href="#">category</a>
            </li>
            <li>
              <a onClick={this.logout} href="#">
                logout
              </a>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default HomeHeader;
